function getTodosByCount(count) {
    return fetch(`https://jsonplaceholder.typicode.com/todos?_limit=${count}`)
        .then((response) => response.json())
        .then((data) => {
        return data;
    })
        .catch(error => {
        console.log(error);
    });
}
document.addEventListener('DOMContentLoaded', (event) => {
    getTodosByCount(5)
        .then((todos) => {
        todos.map(item => console.log(item.title, item.userId, item.completed));
    });
});
